export const Red = Template.bind({})
Red.args = {
  backgroundColor : "red",
  label : "Press me",
  size : "md",
  color : "#1E1E1E",
  fontWeight : "400"
}

export const Green = Template.bind({})
Green.args = {
  backgroundColor : "green",
  label : "Press me",
  size : "md",
  color : "#1E1E1E",
  fontWeight : "400"
}
